import React from 'react';
import Gift1 from '../../../images/gif1.jpg';
import Gift3 from '../../../images/gif2.jpg';
import Gift2 from '../../../images/gif3.jpg';

function GiftWithUs() {
    return(
        <div className={'py-5'}>
            <div className="container">
                <h3 className="fs-40 ff-BonVivant cl-red text-center">Three ways</h3>
                <h4 className="fs-26 fw-bold text-uppercase text-center">you can gift with us</h4>
                <div className="gift_block">
                    <div className="row justify-content-center">
                        <div className="col-md-3">
                            <div className="gift_item">
                                <figure>
                                    <img src={Gift1} alt=""/>
                                </figure>
                                <div className="title_gift">
                                    special collections
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
}
export default GiftWithUs;
